import { Button, Container, TextField, Typography } from "@mui/material";
import React, {useState} from "react";
import { Link, useNavigate } from "react-router-dom";
import { loginFetch } from "../ReduxPages/ReduxSlices/login-slice";
import { useDispatch } from "react-redux";

export default function Login() {
    const [email, setEmail] = useState(''); 
    const navigate = useNavigate();
    const dispatch = useDispatch();  


  function submitHandeler(e){
    e.preventDefault();
    dispatch(loginFetch());  

  }
  return (
    <Container component={"div"}>
      <h2 className="text-center mt-5" style={{ color: "#5CB85C" }}>
        Sign In
      </h2>
      <form className="box d-flex justify-content-center align-items-center flex-column" 
      onSubmit={(e)=>submitHandeler(e)} >
        <Link
          to="/signup"
          className="btn needAnAccount"
          style={{ color: "#5CB85C" }}
        >
          Need An Account
        </Link>
        <TextField
          variant="outlined"
          label="email"
          id="email"
          sx={{ height: "80px", mt: "40px", width: "50%" }}

        />
        <TextField
          variant="outlined"
          type="password"
          label="password"
          id="password"
          sx={{ height: "80px", mt: "20px", width: "50%" }}
        />
        <Typography
          component={"div"}
          sx={{ height: "80px", width: { md: "50%" } }}
        >
          <Button
            className="btn"
            type="submit"
            sx={{
              color: "#5CB85C",
              width: "150px",
              borderColor: "#5CB85C",
              borderWidth: "1px",
              borderStyle: "solid",
              "&:hover": { color: "white", backgroundColor: "#5CB85C" },
            }}
          >
            Login
          </Button>
        </Typography>
      </form>
    </Container>
  );
}
